%% Barrier Tester on Turbine System! (using Sondergaard et al- 2012)
%Model based off of OpenFAST 5MW turbine

%% 5 state Simple! Version to test it out
%Ignore drive train system? Gen and torsion angle are fine anyway?

%Justh have aeros and foreaft? (and rotor of course) - ignoring drive train
%and blades

clear all
close all
%echo on

%% Drive Train Sub system
%% States - 
% omega_r - Rotor angular velocity [rad/s]
%feta_fa - tower top foreaft bending angle (in direction of wind)
%omega_fa - Tower top foreaft bending angular velocity (in direction of wind)
%beta - collective pitch (90 - pitch)
%beta_dot - collective pitch rate (-pitch_rate)



%% Constants
J_r = 19.38e6; % Rotor inertia [kg m2]
B_r = 150e3; % Rotor friction [Nm/(rad/s)]
K_a = 15e6; % Drive train total spring constant [Nm/rad]
B_a = 12.15e6; % Drive train total torsional friction [Nm/(rad/s)]
N = 1/97; % Gear ratio
J_g = 534.12; % Generator inertia [kg m2]
B_g = 0; % Generator friction [Nm/(rad/s)] (Frictionless)

%Tower Top
K_fa = 10.13e9*1.4; % spring constant of the hinge 
B_fa = 221e6*0.5; % damping in the hinge
L = 87.6; %Tower Length
M_n = 557.97e3; %Mass of tower top

%Ignore Wind Disturbance for now! (otherwise look up in table)
rho = 1.22521;
A = 12.45e3;
R = 61.5;
v_wind = 25;
% Also ignoring tower top motion and lead lag bending for simplicity
% Values from paper are designed to resemble NREL 5-MW turbine from FAST

lambda_r = 2.025; % Max rotor velocity [rad/s]
lambda_delta = 441.42e-3; % Ultimate load limit of drive train torsion [rad]
lambda_fa = 9.54e-3*L; % rad/s

%% MAKE SURE SOSTOOLs & SeDuMi (AND YALMIP?) ARE IN PATH

options.solver='MOSEK';
%options.solver='SeDuMi';

pvar x1 x2 x3 x4 x5;

x = [x1;x2;x3;x4;x5];
%Create SOS program
prog = sosprogram(x);

% Define set of monomials for input to sos poly variables - INCLUDE 0th
% Order!!!
VEC_2 = monomials(x,0:4); % So that B up to order 4! (
VEC_1 = monomials(x,0:1); % this creates Sigmas up to order 2 (from x'*Q*x)

%Define initial and unsafe spaces
% Initial state
%g_x0 = x'*Q*x;
%Either Specify operation region or optimise over it!

%[prog, g_x0] = sospolyvar(prog,monomials(x,2),'wscoeff');


g_x0 = ((x1-1.26)^2/(0.2^2) + (x2-0.1)^2/((0.2)^2) + (x3)^2/((0.1)^2) + (x4-70)^2/(10^2)) + (x5+8)^2/(0.5^2); % = 1

%rated is 1.25!!!
%Rated pitch = 11 at wind speed = 15 m/s
%Rated pitch = 17 at wind speed = 20 m/s
%Rated pitch = 23 at wind speed = 25 m/s


%Unsafe Space - Define it as a thin rectangle for numerical reasons?
g_xu_1_1 = (x1 - lambda_r)*(x1 - (lambda_r + 0.3)); % <0
g_xu_1_2 = (x2 - - 3)*(x2 - 1.5);
g_xu_1_3 = (x3 - -2)*(x3 - 2);
g_xu_1_4 = (x4 - (90- 0))*(x4 - (90- 40)); % <0 %Between -20 and 95 pitch
g_xu_1_5 = (x5 - -12)*(x5 - 2); % <0  (x3 between -10 and 10?)

g_xu_2_1 = (x1 - 0)*(x1 - 2.5); % <0
g_xu_2_2 = (x2 - -lambda_fa)*(x2 - (-lambda_fa - 0.3));
g_xu_2_3 = (x3 - -2)*(x3 - 2);
g_xu_2_4 = (x4 - (90- 0))*(x4 - (90- 40)); % <0 %Between -20 and 95 pitch
g_xu_2_5 = (x5 - -12)*(x5 - 2); % <0  (x3 between -10 and 10?)

%Unsafe Ellipse? (/warped sphere)

%g_xu_1 = (x1-lambda_r-0.1)^2/(0.1^2) + (x2-70)^2/(100^2) + (x3)^2/(10^2) - 1;

% State space limits?
x1_lim = (x1 - 0)*(x1 - 2.5); % <0 (x1 between 0 and 3)
x2_lim = (x2 - -1.5)*(x2 - 1.5);
x3_lim = (x3 - -2)*(x3 - 2);
x4_lim = (x4 - (90- 0))*(x4 - (90- 60)); % <0 (x2 between -5 and 100) (pitch from -15 to 100)
x5_lim = (x5 - -12)*(x5 - 2); % <0  (x3 between -10 and 10?)

%Approximated C_q coefficients
C_q_Fit = 3*[-0.0240889231402065,0.00108816365174505,0.0234530529270319,-9.14549613647725e-06,-0.000613719856304388,-0.00158790611519949];
C_t_Fit = 0.5*[-0.407703867241420,0.0153920094483093,0.244017959995536,-0.000121004122118517,-0.00687654914812738,-0.0124188251797834];
%C_t_Fit = C_q_Fit*10;
% No aerodynamics
% C_q_Fit = [0 0 0 0 0 0]; 
 %C_t_Fit = [0 0 0 0 0 0];

% %Linear Aerodynamics
%C_q_Fit = [0.0887009882823798, -0.000994478306871089, -0.0111240840652831, 0 0 0];

%Construct the vector field (x' = f(x))

v_w_eff = v_wind - x3;

Pitch = 90 - x4;

F_aero = 0.5*rho*A*(C_t_Fit(1)*v_w_eff^2 + C_t_Fit(2).*Pitch*v_w_eff^2 + C_t_Fit(3).*(R*x1*v_w_eff) + C_t_Fit(4).*Pitch.^2*v_w_eff^2 +C_t_Fit(5).*Pitch.*(R*x1*v_w_eff) + C_t_Fit(6).*(R*x1).^2);
Tau_aero = 0.5*rho*A*R*(C_q_Fit(1)*v_w_eff^2 + C_q_Fit(2).*Pitch*v_w_eff^2 + C_q_Fit(3).*(R*x1*v_w_eff) + C_q_Fit(4).*Pitch.^2*v_w_eff^2 +C_q_Fit(5).*Pitch.*(R*x1*v_w_eff) + C_q_Fit(6).*(R*x1).^2);


f = [(1/J_r)*(Tau_aero - B_r*x1 );
    x3;
    (1/(M_n*L))*(L*F_aero - B_fa*x3/L + ((M_n*9.81*L-K_fa)/L)*x2);
    x5;
    -0.289*x5 - 0.0289*x4];


%% Create Barrier Function B, and sigma_1 and sigma_2
[prog, B] = sospolyvar(prog,VEC_2);


[prog,sig_0] = sossosvar(prog,VEC_1);
[prog,sig_1] = sossosvar(prog,VEC_1); %forms like x'Qx so order is double VEC
[prog,sig_2] = sossosvar(prog,VEC_1);
[prog,sig_3] = sossosvar(prog,VEC_1);
[prog,sig_4] = sossosvar(prog,VEC_1);
[prog,sig_5] = sossosvar(prog,VEC_1);
[prog,sig_6] = sossosvar(prog,VEC_1);
[prog,sig_7] = sossosvar(prog,VEC_1);
[prog,sig_8] = sossosvar(prog,VEC_1);
[prog,sig_9] = sossosvar(prog,VEC_1);
[prog,sig_10] = sossosvar(prog,VEC_1);
[prog,sig_11] = sossosvar(prog,VEC_1);
[prog,sig_12] = sossosvar(prog,VEC_1);
[prog,sig_13] = sossosvar(prog,VEC_1);
[prog,sig_14] = sossosvar(prog,VEC_1);
[prog,sig_15] = sossosvar(prog,VEC_1);
[prog,sig_16] = sossosvar(prog,VEC_1);


%% Constraints!

% so B is positive/negative in respective regions and gradB is negative 
% Inequalities are >= 0 
prog = sosineq(prog,-B -0.1 + sig_0*(g_x0-1));
%                    8         4? + 2?
%Square Unsafe Region
g_xu_1_total = sig_1*g_xu_1_1 + sig_2*g_xu_1_2 + sig_3*g_xu_1_3 + sig_4*g_xu_1_4 + sig_5*g_xu_1_5;
g_xu_2_total = sig_11*g_xu_2_1 + sig_12*g_xu_2_2 + sig_13*g_xu_2_3 + sig_14*g_xu_2_4 + sig_15*g_xu_2_5;

prog = sosineq(prog, B - 0.1 + g_xu_1_total);
prog = sosineq(prog, B - 0.1 + g_xu_2_total);


prog = sosineq(prog, - (diff(B,x1)*f(1) + diff(B,x2)*f(2) + diff(B,x3)*f(3) + diff(B,x4)*f(4) + diff(B,x5)*f(5)) + sig_6*x1_lim + sig_7*x2_lim + sig_8*x3_lim + sig_9*x4_lim + sig_10*x5_lim);

%Solve!! (solver already called at top)
prog = sossolve(prog,options);

%Get Solution!
SOLV = sosgetsol(prog,B)
g_x = sosgetsol(prog,g_x0)
%r_opt = sosgetsol(prog,r)
sig_1 = sosgetsol(prog,sig_1)
%sig_2 = sosgetsol(prog,sig_2)


SOLV = p2s(SOLV);
g_x = p2s(g_x);
sig_1 = p2s(sig_1);
%Plot Solution

%% Barrier Function Plot 1
B = matlabFunction(SOLV);

xx1 = -2:0.05:3;
xx4 = -10:1:90;
xx5 = -10:0.2:10;
[x1,x4] = meshgrid(xx1,xx4);

figure
mesh(x1,x4,B(x1,0.2,0,90-x4,-8))
hold on


M = min(B(x1,0.2,0,90-x4,-8),[],'all','linear');
[M_x,M_y] = find(B(x1,0.2,0,90-x4,-8) == M);

x1_max = xx1(M_y);
x2_max = 90-xx4(M_x);

lengt = 101;
CO(:,:,1) = ones(lengt); % red
CO(:,:,2) = zeros(lengt); % green
CO(:,:,3) = zeros(lengt); % blue
mesh(zeros(lengt)+2.025,90-x4,x1*10,CO)
hold on
CO(:,:,1) = zeros(lengt); % red
CO(:,:,2) = ones(lengt); % green
CO(:,:,3) = zeros(lengt); % blue
mesh(x1,90-x4,zeros(lengt),CO)

xlim([-3 3])
ylim([-20 100])
zlim([-20 200])

xlabel('Rotor Angular Velocity (rad/s)')
ylabel('Initial Pitch (Degrees)')
zlabel('Barrier Function')
title('Barrier Function')

